// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./Verifier.sol";

contract Voting is Ownable {
    // Instance of the Verifier contract.
    Verifier public verifier;

    // Constructor sets the deployer as owner and stores the address of the deployed Verifier.
    constructor(address verifierAddress) Ownable(msg.sender) {
        verifier = Verifier(verifierAddress);
    }

    // ----- STRUCTS & ENUMS -----
    enum VoteType { Approval, RankedChoice, Quadratic }

    struct Voter {
        bool hasVoted;
    }

    // ----- STATE VARIABLES -----
    mapping(address => Voter) public voters;
    mapping(uint => mapping(address => uint)) public votes;
    uint public voteId;

    // Events for analytics
    event VoteCast(address indexed voter, uint indexed voteId, VoteType voteType);
    event DisputeTriggered(uint indexed voteId, string reason);

    // Modifier to prevent double voting
    modifier notVoted() {
        require(!voters[msg.sender].hasVoted, "Voter has already voted");
        _;
    }

    // ----- VOTING FUNCTIONS -----
    // Each function requires the proof parameters in the format expected by the verifier:
    // - a: uint[2]
    // - b: uint[2][2]
    // - c: uint[2]
    // - input: uint[3]

    function castApprovalVote(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[3] memory input,
        uint candidateId
    ) external notVoted {
        require(verifier.verifyTx(_makeProof(a, b, c), input), "Invalid ZK Proof");
        voters[msg.sender].hasVoted = true;
        votes[candidateId][msg.sender] = 1;
        voteId++;
        emit VoteCast(msg.sender, voteId, VoteType.Approval);
    }

    function castRankedVote(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[3] memory input,
        uint[] calldata candidateIds
    ) external notVoted {
        require(verifier.verifyTx(_makeProof(a, b, c), input), "Invalid ZK Proof");
        voters[msg.sender].hasVoted = true;
        voteId++;
        emit VoteCast(msg.sender, voteId, VoteType.RankedChoice);
    }

    function castQuadraticVote(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c,
        uint[3] memory input,
        uint candidateId,
        uint voteTokens
    ) external notVoted {
        require(verifier.verifyTx(_makeProof(a, b, c), input), "Invalid ZK Proof");
        voters[msg.sender].hasVoted = true;
        votes[candidateId][msg.sender] = voteTokens;
        voteId++;
        emit VoteCast(msg.sender, voteId, VoteType.Quadratic);
    }

    // ----- DISPUTE RESOLUTION -----
    function triggerDispute(uint _voteId, string calldata reason) external onlyOwner {
        emit DisputeTriggered(_voteId, reason);
    }

    // ----- INTERNAL HELPER FUNCTION -----
    // Constructs a Proof struct from the provided proof parameters.
    function _makeProof(
        uint[2] memory a,
        uint[2][2] memory b,
        uint[2] memory c
    ) internal pure returns (Verifier.Proof memory proof) {
        // Construct the proof using the Pairing types defined in Verifier.sol.
        proof.a = Pairing.G1Point(a[0], a[1]);
        proof.b = Pairing.G2Point(b[0], b[1]);
        proof.c = Pairing.G1Point(c[0], c[1]);
    }
}

